sys_variable_value.value:
(function execute(inputs, outputs) {
    var vGR = new GlideRecord('x_147145_demo_mark_versions');
    vGR.addQuery('demo', inputs.demo_sys_id);
    vGR.orderByDesc('version');
    vGR.query();

    if(vGR.next()) {
        outputs.version_number = vGR.getValue('version');
    }
})(inputs, outputs);

